class Fetcher{

    getAllEvents() {
        const httpOptions = {
            headers: { 'x-teamengine-test': "YfKFyOBnLBvudfn" }
        };
        const url = `https://projects.teamengine.com/calendar/events`;
        return fetch(url, httpOptions).then(response => {return response.text()});
    }

}
export default Fetcher;
